  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108070 includes chemical,
  discrete sample, physical and profile data collected from LAURENCE M. GOULD in the
  South Atlantic Ocean from 2006-03-21 to 2006-04-04 and retrieved during cruise 33LG20060321
  (LMG200603). These data include DELTA CARBON-13, DELTA CARBON-14, DISSOLVED INORGANIC
  CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Partial
  pressure (or fugacity) of carbon dioxide, Potential temperature (theta), SALINITY,
  SILICATE and WATER TEMPERATURE. The instruments used to collect these data include
  CTD, Carbon dioxide (CO2) gas analyzer, Coulometer for DIC measurement, Flask with
  closed headspace for discrete carbon dioxide (CO2) measurement and bottle. These
  data were collected by Colm Sweeney of US DOC; NOAA; OAR; Earth System Research
  Laboratory; Climate Monitoring and Diagnostics Laboratory as part of the CLIVAR_A21_2006
  data set.nnThe International CLIVAR Global Ocean Carbon and Repeat Hydrography Program
  carries out a systematic and global re-occupation of select WOCE/JGOFS hydrographic
  sections to quantify changes in storage and transport of heat, fresh water, carbon
  dioxide (CO2), and related parameters.\",\n\t\"license_title\": null,\n\t\"extras\":
